script: |
  super -f text -I q5577.spq | sort > q5577.out

inputs:
  - name: q5577.spq
    data: |
      SELECT * FROM tab1 (FORMAT parquet) AS cor0 WHERE col0 * col0 * ( 69 ) NOT IN ( ( - col2 ) * ( col1 * + col0 - 64 ) );
  - name: tab1

outputs:
  - name: q5577.out
    data: |
      51	14	96
      85	5	59
      91	47	68
